  };
  return (
    <center>
      <div>
        <li>
          <ul>What type of wine would you like?</ul>
          <ul>
            <input type="checkbox" id="redWine" />
            <label for="redWine"> Red</label>
            <br />
            <input type="checkbox" id="whiteWine" />
            <label for="whiteWine"> White</label>
            <br />
            <input type="checkbox" id="dessertWine" />
            <label for="dessertWine"> Dessert</label>
          </ul>
          <ul>How expensive?</ul>
          <ul>
            <input
              type="range"
              id="priceScale"
              name = "$"
              min="10"
              max="500"
              onChange={getInputValue}
              append = "$"
            /><br/>
            <output>$100</output>
          </ul>
          <ul>How sweet?</ul>
          <ul>
            <input
              type="range"
              id="sweetScale"
              name = ""
              min="1"
              max="100"
              onChange={getInputValue}
            /><br/>
            <output>50</output>%
          </ul>
          <ul>What Year?</ul>
          <ul>
            <input
              type="range"
              id="yearScale"
              name = "Circa "
              min="1750"
              max="2022"
              onChange={getInputValue}
            /><br/>
            <output>Circa 1750</output>
          </ul>
          <ul>Region?</ul>
          <ul>
            <input type="text" id="regionInput" />
          </ul>
        </li>
        <button id="submit" onClick={displayWine}>
          Submit
        </button>
      </div>
    </center>
  );
}

